def transform(sequence):
    count = {}
    for i, num in enumerate(sequence):
        if num != '0':
            count[num] = count.get(num, 0) + 1
    result = '0'*(len(sequence) - sum(count.values()))
    for num, freq in count.items():
        result += '0'*freq + num*freq
    return result
